import React from 'react'
import {RecentServices} from "../components/recentServices";
const data = [
    {
        title: 'Заявка на услугу «Ипотека на полвека»',
        id: 1,
        status: 'accepted',
    },
    {
        title: 'Заявка на услугу «Запись к врачу»',
        id: 2,
        status: 'consideration'
    }
]
export default function MainPage(){

    return(
        <div >
            <ul className='main-card-services'>
                <p className="text-main">Недавние заявки</p>
                { data.map((data) => { console.log(data)}) }
                { data.map((data) => <RecentServices Props={data} key={data.id} />) }
            </ul>
        </div>
    )
}
